  return (
  <div className='cards'>
    <h1>Check out these destinations!</h1>
    <div className="cards__container">
      <div className="cards__wrapper">
        <ul className="cards__items">
          <CardItem src="../../public/images/img-9.jpg" text="Explore the hidden waterfall deep inside the Amazon" label="Adventure" path="/services" />
        </ul>
      </div>
    </div>
  </div>
  )
}

export default Cards;
